import React from 'react';


const  FaceRecognition = ({imgUrl}) => {
    return (
        <div className='center'>
            <div className='absolute mt2 mb2'>
            <img id='inputImage' alt='' src= {imgUrl} width='500px' height='auto'  />
            </div>
            
        </div>
    );
}

export default FaceRecognition;
